import { createIcon } from "../icon/createIcon";

export const PauseIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="PauseIcon">
    <path d="M2 1h3v10H2V1zm1 1v8h1V2H3zm4-1h3v10H7V1zm1 1v8h1V2H8z" />
  </svg>,
  "Pause",
  "pause"
);
